real_T proc_control::proc_control_norm_p(const real_T x[169])
{
  real_T y;
  int32_T b_j;
  boolean_T exitg1;
  y = 0.0;
  b_j = 0;
  exitg1 = false;
  while ((!exitg1) && (b_j < 13)) {
    real_T s;
    s = 0.0;
    for (int32_T b_i{0}; b_i < 13; b_i++) {
      s += std::abs(x[13 * b_j + b_i]);
    }

    if (std::isnan(s)) {
      y = (rtNaN);
      exitg1 = true;
    } else {
      if (s > y) {
        y = s;
      }

      b_j++;
    }
  }

  return y;
}

